; ---------------------------------------------------------------------------
; Sonic the Hedgehog (Prototype) Disassembly
; KatKurin 2024
; ---------------------------------------------------------------------------
; Header and initial program
; ---------------------------------------------------------------------------

HEADER:
        dc.l $FFFE00		; Initial SP
        dc.l SECURITY		; Initial PC

        dc.l ERROR_BUS		; Error vectors
        dc.l ERROR_ADDRESS
        dc.l ERROR_ILLEGAL
        dc.l ERROR_ZERODIV
        dc.l ERROR_CHKINST
        dc.l ERROR_TRAPV
        dc.l ERROR_PRIVILEGE
        dc.l ERROR_TRACE
        dc.l ERROR_LINEA
        dc.l ERROR_LINEF

        dc.l ERROR,ERROR,ERROR,ERROR    ; Reserved (Unused)
        dc.l ERROR,ERROR,ERROR,ERROR
        dc.l ERROR,ERROR,ERROR,ERROR

        dc.l ERROR		; Spurious Interrupt
        dc.l UINT               ; IRQ1
        dc.l UINT               ; IRQ2 (EXT)
        dc.l UINT               ; IRQ3
        dc.l HBLANK             ; IRQ4 (Horizontal blanking interrupt)
        dc.l UINT               ; IRQ5
        dc.l VBLANK             ; IRQ6 (Vertical blanking interrupt)
        dc.l UINT

        dc.l UINT,UINT,UINT,UINT	; TRAP Exceptions
        dc.l UINT,UINT,UINT,UINT	; (Unused)
        dc.l UINT,UINT,UINT,UINT
        dc.l UINT,UINT,UINT,UINT

        dc.l UINT,UINT,UINT,UINT	; Reserved (Unused)
        dc.l UINT,UINT,UINT,UINT
        dc.l UINT,UINT,UINT,UINT
        dc.l UINT,UINT,UINT,UINT

; ---------------------------------------------------------------------------
; Game Information (Stock SDK)
; ---------------------------------------------------------------------------

GAME_ID:
		dc.b 'SEGA MEGA DRIVE '
        	dc.b '(C)SEGA 1989.JAN'
        	dc.b '                        '
        	dc.b '                        '
        	dc.b 'GM 00000000-00'
CHECKSUM:       dc.w     0
PERIPHERALS:    dc.b 'J               '
GAMESTART:      dc.l CARTRIDGE
GAMEEND:        dc.l CARTRIDGEE-1
RAMSTART:       dc.l WORKRAM
RAMEND:         dc.l WORKRAME-1
        	dc.b '    '
        	dc.b '    '
        	dc.b '    '
        	dc.b '            '
        	dc.b '                        '
        	dc.b 'JU              '
HEADEREND:

; ---------------------------------------------------------------------------
; Undefined Interrupt/Vector. Stop 68k
; ---------------------------------------------------------------------------

UINT:
        nop
        nop
        bra.s   UINT

; =============== S U B R O U T I N E =======================================


SECURITY:
                tst.l   (IOCTRL1_).l

$$IOCTRL3_DIP:
                bne.w   Start
                tst.w   (IOCTRL3_).l
                bne.s   $$IOCTRL3_DIP
                lea     SECURITYDATA(pc),a5
                movem.l (a5)+,d5-d7/a0-a4
                move.w  -$1100(a1),d0
                andi.w  #$F00,d0
                beq.s   $$NoTMSS
                move.l  #'SEGA',$2F00(a1)

$$NoTMSS:                               ; ...
                move.w  (a4),d0
                moveq   #0,d0
                movea.l d0,a6
                move.l  a6,usp
                moveq   #23,d1          ; Set to loop for each register -1

$$SetVDPRegs:                           ; ...
                move.b  (a5)+,d5
                move.w  d5,(a4)
                add.w   d7,d5
                dbf     d1,$$SetVDPRegs ; Loop until 0
                move.l  #VRAMDMA,(a4)
                move.w  d0,(a3)
                move.w  d7,(a1)
                move.w  d7,(a2)

$$WaitForZ80:                           ; ...
                btst    d0,(a1)
                bne.s   $$WaitForZ80
                moveq   #Z80InitE-SECURITY_Z80-1,d2

$$LoadZ80Init:                          ; ...
                move.b  (a5)+,(a0)+
                dbf     d2,$$LoadZ80Init
                move.w  d0,(a2)
                move.w  d0,(a1)
                move.w  d7,(a2)

$$ClrRAM:                               ; ...
                move.l  d0,-(a6)
                dbf     d6,$$ClrRAM
                move.l  #$81048F02,(a4) ; SET_VDP_AUTO_INC_VALUE_$0002
                                        ; GENESIS_DISPLAY_MODE_BIT2
                                        ; SET_NTSC_MODE
                                        ; DISABLE_DMA
                                        ; DISABLE_VBLANK
                                        ; DISABLE_DISPLAY
                                        ; GENESIS_DISPLAY_MODE_BIT7
                move.l  #CRAMWRITE,(a4) ; DO_WRITE_TO_CRAM_AT_$0000_ADDR
                                        ; DO_OPERATION_WITHOUT_DMA

loc_276:
                moveq   #31,d3

$$ClrCRAM:                              ; ...
                move.l  d0,(a3)
                dbf     d3,$$ClrCRAM
                move.l  #VSRAMWRITE,(a4)
                moveq   #19,d4

$$ClrVSRAM:                             ; ...
                move.l  d0,(a3)
                dbf     d4,$$ClrVSRAM
                moveq   #3,d5

$$PSGInitLoop:                          ; ...
                move.b  (a5)+,$10(a3)
                dbf     d5,$$PSGInitLoop
                move.w  d0,(a2)
                movem.l (a6),d0-d7/a0-a6
                move    #$2700,sr
                bra.s   Start
; End of function SECURITY

; ---------------------------------------------------------------------------
SECURITYDATA:   dc.l $8000              ; ...
                dc.l $3FFF
                dc.l $100
                dc.l Z80RAM
                dc.l Z80BUS
                dc.l Z80RES
                dc.l VDPDATA
                dc.l VDPCTRL
SECURITY_VDP:   dc.b   4
                dc.b $14
                dc.b $30
                dc.b $3C
                dc.b   7
                dc.b $6C
                dc.b   0
                dc.b   0
                dc.b   0
                dc.b   0
                dc.b $FF
                dc.b   0
                dc.b $81
                dc.b $37
                dc.b   0
                dc.b   1
                dc.b   1
                dc.b   0
                dc.b   0
                dc.b $FF
                dc.b $FF
                dc.b   0
                dc.b   0
                dc.b $80
SECURITY_Z80:   dc.b $AF,  1,$D7,$1F    ; ...
                dc.b $11,$29,  0,$21
                dc.b $28,  0,$F9,$77
                dc.b $ED,$B0,$DD,$E1
                dc.b $FD,$E1,$ED,$47
                dc.b $ED,$4F,  8,$D9
                dc.b $F1,$C1,$D1,$E1
                dc.b   8,$D9,$F1,$D1
                dc.b $E1,$F9,$F3,$ED
                dc.b $56,$36,$E9,$E9
SECURITY_PSG:   dc.b $9F,$BF,$DF,$FF

; =============== S U B R O U T I N E =======================================


Start:                                  ; ...
                btst    #6,(IOCTRL3).l
                beq.s   $$ForceColdBoot
                cmpi.l  #'init',(bootFlag).w
                beq.w   $$WarmBoot

$$ForceColdBoot:                        ; ...
                movea.l #HeaderEnd,a0   ; Get header end location
                movea.l #GAMEEND,a1     ; Get the catalogued ROM end location
                move.l  (a1),d0
                moveq   #0,d1

$$CalculateChkSum:                      ; ...
                add.w   (a0)+,d1        ; Add current ROM location to d1 (previous location)
                cmp.l   a0,d0           ; Check if we're at the end of the ROM yet
                bcc.s   $$CalculateChkSum ; If not, continue the loop
                movea.l #CHECKSUM,a1    ; Compare against the catalogued checksum value
                cmp.w   (a1),d1
                nop                     ; Dead code, would have been:
                                        ;
                                        ; bne.w ChecksumFailed
                nop
                lea     (stack).w,a6
                moveq   #0,d7
                move.w  #($200/4)-1,d6  ; Clear 0x200 bytes from stack

$$ClearGameVars:                        ; ...
                move.l  d7,(a6)+
                dbf     d6,$$ClearGameVars
                move.b  (VERSION).l,d0
                andi.b  #%11000000,d0
                move.b  d0,(hardwareVersion).w
                move.w  #1,(levelselectFlag).w
                move.l  #'init',(bootFlag).w

$$WarmBoot:                             ; ...
                lea     (WORKRAM).l,a6
                moveq   #0,d7
                move.w  #($FE00/4)-1,d6 ; Clear most of RAM up to 0xFE00

$$ClearRAM:                             ; ...
                move.l  d7,(a6)+
                dbf     d6,$$ClearRAM
                bsr.w   InitVDP
                bsr.w   InitSound
                bsr.w   InitJoypads
                move.b  #0,(gamemode).w
; End of function Start


; =============== S U B R O U T I N E =======================================


Main:                                   ; ...
                move.b  (gamemode).w,d0
                andi.w  #$1C,d0
                jsr     $$Index(pc,d0.w)
                bra.s   Main
; ---------------------------------------------------------------------------

$$Index:                                ; ...
                bra.w   GM_LOGO
; ---------------------------------------------------------------------------
                bra.w   GM_TITLE
; ---------------------------------------------------------------------------
                bra.w   GM_LEVEL
; ---------------------------------------------------------------------------
                bra.w   GM_LEVEL
; ---------------------------------------------------------------------------
                bra.w   GM_SPECIAL
; ---------------------------------------------------------------------------
                rts
; ---------------------------------------------------------------------------
                bsr.w   InitVDP
; End of function Main


; =============== S U B R O U T I N E =======================================


CheckSumFailed:
                move.l  #CRAMWRITE,(VDPCTRL).l
                moveq   #64-1,d7

$$FillCRAM:                             ; ...
                move.w  #$E,(VDPDATA).l
                dbf     d7,$$FillCRAM

$$Stop68K:                              ; ...
                bra.s   $$Stop68K
; End of function CheckSumFailed


; =============== S U B R O U T I N E =======================================


ERROR_BUS:                              ; ...
                move.b  #errorBus,(errorCode).w
                bra.s   GetErrorData
; End of function ERROR_BUS


; =============== S U B R O U T I N E =======================================


ERROR_ADDRESS:                          ; ...
                move.b  #errorIllegal,(errorCode).w
                bra.s   GetErrorData
; End of function ERROR_ADDRESS


; =============== S U B R O U T I N E =======================================


ERROR_ILLEGAL:                          ; ...
                move.b  #errorAddress,(errorCode).w
                addq.l  #2,2(sp)
                bra.s   HandleError
; End of function ERROR_ILLEGAL


; =============== S U B R O U T I N E =======================================


ERROR_ZERODIV:                          ; ...
