; End of function ERROR_LINEF


; =============== S U B R O U T I N E =======================================


ERROR:                                  ; ...
                move.b  #0,(errorCode).w
                bra.s   HandleError
; ---------------------------------------------------------------------------

GetErrorData:                           ; ...
                move    #$2700,sr
                addq.w  #2,sp
                move.l  (sp)+,(storedSP).w
                addq.w  #2,sp
                movem.l d0-d7/a0-a7,(objectStates).w
                bsr.w   DisplayErrorMsg
                move.l  2(sp),d0
                bsr.w   ShowErrorValue
                move.l  (storedSP).w,d0
                bsr.w   ShowErrorValue
                bra.s   $$Exit
; ---------------------------------------------------------------------------

HandleError:                            ; ...
                move    #$2700,sr
                movem.l d0-d7/a0-a7,(objectStates).w
                bsr.w   DisplayErrorMsg
                move.l  2(sp),d0
                bsr.w   ShowErrorValue

$$Exit:                                 ; ...
                bsr.w   $$WaitForInput
                movem.l (objectStates).w,d0-d7/a0-a7
                move    #$2300,sr
                rte
; End of function ERROR


; =============== S U B R O U T I N E =======================================


DisplayErrorMsg:                        ; ...
                lea     (VDPDATA).l,a6
                move.l  #$78000003,(VDPCTRL).l ; DO_WRITE_TO_VRAM_AT_$F800_ADDR
                                        ; DO_OPERATION_WITHOUT_DMA
                lea     (ArtUnc_Text).l,a0
                move.w  #$27F,d1

$$LoadText:                             ; ...
                move.w  (a0)+,(a6)
                dbf     d1,$$LoadText
                moveq   #0,d0
                move.b  (errorCode).w,d0
                move.w  ErrorMsgs(pc,d0.w),d0
                lea     ErrorMsgs(pc,d0.w),a0
                move.l  #$46040003,(VDPCTRL).l ; DO_WRITE_TO_VRAM_AT_$C604_ADDR
                                        ; DO_OPERATION_WITHOUT_DMA
                moveq   #18,d1

$$ShowMessage:                          ; ...
                moveq   #0,d0
                move.b  (a0)+,d0
                addi.w  #$790,d0
                move.w  d0,(a6)
                dbf     d1,$$ShowMessage
                rts
; End of function DisplayErrorMsg

; ---------------------------------------------------------------------------
ErrorMsgs:      dc.w ascii_Error1-*     ; ...
                dc.w ascii_Error2-ErrorMsgs
                dc.w ascii_Error3-ErrorMsgs
                dc.w ascii_Error4-ErrorMsgs
                dc.w ascii_Error5-ErrorMsgs
