ascii_Error1:   dc.b 'ERROR EXCEPTION    ' ; ...
ascii_Error2:   dc.b 'BUS ERROR          ' ; ...
ascii_Error3:   dc.b 'ADDRESS ERROR      ' ; ...
ascii_Error4:   dc.b 'ILLEGAL INSTRUCTION' ; ...
