; =============== S U B R O U T I N E =======================================


ShowErrorValue:                         ; ...
                move.w  #$7CA,(a6)
                moveq   #7,d2

$$GetChars:                             ; ...
                rol.l   #4,d0
                bsr.s   $$HexToText
                dbf     d2,$$GetChars
                rts
; ---------------------------------------------------------------------------

$$HexToText:                            ; ...
                move.w  d0,d1
                andi.w  #$F,d1
                cmpi.w  #$A,d1
                bcs.s   $$Numbers
                addq.w  #7,d1

$$Numbers:                              ; ...
                addi.w  #$7C0,d1
                move.w  d1,(a6)
                rts
; ---------------------------------------------------------------------------

$$WaitForInput:                         ; ...
                bsr.w   ReadJoypads
                cmpi.b  #%100000,(joypadPress).w
                bne.w   $$WaitForInput
                rts
; End of function ShowErrorValue

