                cmpi.b  #6,(objectSlot00+obj.Action).w ; Sonic routine counter
                bcc.s   $$Paused

$$ProcessObjLoop:                       ; ...
                move.b  obj.ID(a0),d0
                beq.s   $$EmptySlot
                add.w   d0,d0
                add.w   d0,d0
                movea.l ObjectIndex-4(pc,d0.w),a1 ; No zero offset - start at 1
                jsr     (a1)
                moveq   #0,d0

$$EmptySlot:                            ; ...
                lea     obj.Size(a0),a0
                dbf     d7,$$ProcessObjLoop
                rts
; ---------------------------------------------------------------------------

$$Paused:                               ; ...
                moveq   #32-1,d7
                bsr.s   $$ProcessObjLoop
                moveq   #96-1,d7

$$PauseObjLoop:                         ; ...
                moveq   #0,d0
                move.b  obj.ID(a0),d0
                beq.s   $$SkipDisplay
                tst.b   obj.RenderFlags(a0)
                bpl.s   $$SkipDisplay
                bsr.w   _objectDraw     ; Only display sprites while paused

$$SkipDisplay:                          ; ...
                lea     obj.Size(a0),a0
                dbf     d7,$$PauseObjLoop
                rts
; End of function RunObjects

