$$Object:                               ; ...
                movea.w (a4,d6.w),a0
                tst.b   obj.ID(a0)
                beq.w   $$SkipObject
                bclr    #7,obj.RenderFlags(a0)
                move.b  obj.RenderFlags(a0),d0
                move.b  d0,d4
                andi.w  #%1100,d0
                beq.s   $$DrawFixed
