                moveq   #0,d0
                move.b  obj.XDraw(a0),d0
                move.w  obj.X(a0),d3
                sub.w   (a1),d3
                move.w  d3,d1
                add.w   d0,d1
                bmi.w   $$SkipObject
                move.w  d3,d1
                sub.w   d0,d1
                cmpi.w  #$140,d1
                bge.s   $$SkipObject
                addi.w  #$80,d3
                btst    #4,d4
                beq.s   $$AssumeHeight
                moveq   #0,d0
                move.b  obj.YRad(a0),d0
                move.w  obj.Y(a0),d2
                sub.w   4(a1),d2
                move.w  d2,d1
                add.w   d0,d1
                bmi.s   $$SkipObject
                move.w  d2,d1
                sub.w   d0,d1
                cmpi.w  #$E0,d1
                bge.s   $$SkipObject
                addi.w  #$80,d2
                bra.s   $$DrawObject
; ---------------------------------------------------------------------------

$$DrawFixed:                            ; ...
                move.w  obj.YScr(a0),d2
                move.w  obj.X(a0),d3
                bra.s   $$DrawObject
; ---------------------------------------------------------------------------

$$AssumeHeight:                         ; ...
                move.w  obj.Y(a0),d2
                sub.w   4(a1),d2
                addi.w  #128,d2
                cmpi.w  #96,d2
                bcs.s   $$SkipObject
                cmpi.w  #384,d2
                bcc.s   $$SkipObject

$$DrawObject:                           ; ...
                movea.l obj.Map(a0),a1
                moveq   #0,d1
                btst    #5,d4
                bne.s   $$StaticMap
                move.b  obj.Frame(a0),d1
                add.b   d1,d1
                adda.w  (a1,d1.w),a1
                move.b  (a1)+,d1
                subq.b  #1,d1
                bmi.s   $$SetVisible

$$StaticMap:                            ; ...
                bsr.w   _spriteBuildToBuffer

$$SetVisible:                           ; ...
                bset    #7,obj.RenderFlags(a0)

$$SkipObject:                           ; ...
                addq.w  #2,d6
                subq.w  #2,(a4)
                bne.w   $$Object

$$NextPriorityLevel:                    ; ...
                lea     $80(a4),a4
                dbf     d7,$$Priority
                move.b  d5,(spriteCount).w
                cmpi.b  #80,d5
                beq.s   $$LimitReached
                move.l  #0,(a2)
                rts
; ---------------------------------------------------------------------------

$$LimitReached:                         ; ...
                move.b  #0,-5(a2)
                rts
; End of function DrawObjects


