                moveq   #0,d0
                move.b  (getObjectsMode).w,d0
                move.w  $$Index(pc,d0.w),d0
                jmp     $$Index(pc,d0.w)
; ---------------------------------------------------------------------------
$$Index:                                ; ...
                dc.w GetObjects_Init-*
                dc.w GetObjects_Main-$$Index
; ---------------------------------------------------------------------------

GetObjects_Init:                        ; ...
                addq.b  #2,(getObjectsMode).w
                move.w  (zone).w,d0
                lsl.b   #6,d0
                lsr.w   #4,d0
                lea     (ObjPosIndex).l,a0
                movea.l a0,a1
                adda.w  (a0,d0.w),a0
                move.l  a0,(objectChunkRight).w
                move.l  a0,(objectChunkLeft).w
                adda.w  2(a1,d0.w),a1
                move.l  a1,(objunkChunkRight).w
                move.l  a1,(objunkChunkLeft).w
                lea     (objectStates).w,a2 ; Reset object flags
                move.w  #$101,(a2)+
                move.w  #$5F-1,d0

$$ClearStates:                          ; ...
                clr.l   (a2)+
                dbf     d0,$$ClearStates
                move.w  #-1,(objectChunk).w

GetObjects_Main:                        ; ...
                lea     (objectStates).w,a2
                moveq   #0,d2
                move.w  (cameraMainX).w,d6
                andi.w  #$FF80,d6
                cmp.w   (objectChunk).w,d6
                beq.w   $$Exit
                bge.s   $$GetObjectsLeft
                move.w  d6,(objectChunk).w

$$GetObjectsRight:
                movea.l (objectChunkLeft).w,a0
                subi.w  #$80,d6
                bcs.s   $$RightDone

$$RightLoop:                            ; ...
                cmp.w   -6(a0),d6
                bge.s   $$RightDone
                subq.w  #6,a0
                tst.b   objtbl.ID(a0)
                bpl.s   $$SkipStateRight
                subq.b  #1,1(a2)
                move.b  1(a2),d2

$$SkipStateRight:                       ; ...
                bsr.w   $$LoadEntry
                bne.s   $$Failed
                subq.w  #6,a0
                bra.s   $$RightLoop
; ---------------------------------------------------------------------------

$$Failed:                               ; ...
                tst.b   objtbl.ID(a0)
                bpl.s   $$Rewind
                addq.b  #1,1(a2)

$$Rewind:                               ; ...
                addq.w  #6,a0

$$RightDone:                            ; ...
                move.l  a0,(objectChunkLeft).w
                movea.l (objectChunkRight).w,a0
                addi.w  #$300,d6

$$FindRightChunk:                       ; ...
                cmp.w   -6(a0),d6
                bgt.s   $$FoundRight
                tst.b   -2(a0)
                bpl.s   $$NextObjRight
                subq.b  #1,(a2)

$$NextObjRight:                         ; ...
                subq.w  #6,a0
                bra.s   $$FindRightChunk
; ---------------------------------------------------------------------------

$$FoundRight:                           ; ...
                move.l  a0,(objectChunkRight).w
                rts
; ---------------------------------------------------------------------------

$$GetObjectsLeft:                       ; ...
                move.w  d6,(objectChunk).w
                movea.l (objectChunkRight).w,a0
                addi.w  #$280,d6

$$LeftLoop:                             ; ...
                cmp.w   objtbl.X(a0),d6
                bls.s   $$LeftDone
                tst.b   objtbl.ID(a0)
                bpl.s   $$SkipStateLeft
                move.b  (a2),d2
                addq.b  #1,(a2)

$$SkipStateLeft:                        ; ...
                bsr.w   $$LoadEntry
                beq.s   $$LeftLoop

$$LeftDone:                             ; ...
                move.l  a0,(objectChunkRight).w
                movea.l (objectChunkLeft).w,a0
                subi.w  #$300,d6
                bcs.s   $$FoundLeft

$$FindLeftChunk:                        ; ...
                cmp.w   objtbl.X(a0),d6
                bls.s   $$FoundLeft
                tst.b   objtbl.ID(a0)
                bpl.s   $$NextObjLeft
                addq.b  #1,1(a2)

$$NextObjLeft:                          ; ...
                addq.w  #6,a0
                bra.s   $$FindLeftChunk
; ---------------------------------------------------------------------------

$$FoundLeft:                            ; ...
                move.l  a0,(objectChunkLeft).w
                rts
; ---------------------------------------------------------------------------

??_getobjectsUnknown:                   ; ...
                movea.l (objunkChunkRight).w,a0
                move.w  (cameraFGX).w,d0
